class LocalgeminiModel: 
    def __init__(self  , data):
        self.data = data
        self.model =  genai.GenerativeModel.from_cached_content(cached_content=cache)
    

    def preprocess(data):
        refined_data = []
        for d in data :
            refined_data.append(d.text)

        return refined_data

    async def predict(self , text):
        combined_text = "\n".join(text)
        try: 
            response = []
            classes = self.model.generate_content(combined_text)
            i = 0
            for _ in classes : 
                response.append({"text" : text[i] , "predicted_class" : _})
                i += 1

            return response
            
        except Exception as e:
            print("[gemini.py] error in predict : "  , e)
        



if __name__ == "__main__":
    data = sys.argv
